  selector: 'app-base-container',
  standalone: true,
  imports: [CommonModule, NgTemplateOutlet],
  templateUrl: './base-container.component.html',
})
export class BaseContainerComponent {

}
<section class="container d-flex justify-content-center align-items-center" [ngTemplateOutlet]="test">base-container
  works!
</section>
